import React from 'react';

export const Modal = ({ isOpen, close}) => {
  if (!isOpen) return null;

  return (
    <div className="modal">
      <div className="modal-content">
        <button onClick={close} className="btn close-button">Close</button>
      </div>
    </div>
  );
};
